import React from "react";
import "./index.css";
import PropTypes from "prop-types"; 

function Menu({button_titles}) {
    return <header className="menu">
                <div id="buttons">
                    {button_titles.map((title, id) => {
                        return <button className={`menu_button menu_button_${id+1}`}>{title}</button>
                    })}
                </div>
            </header>
}

Menu.propTypes = {
    buttons_title: PropTypes.arrayOf(PropTypes.string).isRequired,
}

export default Menu
